import React, {Fragment} from 'react';
import {Breadcrumb, BreadcrumbItem} from "reactstrap";
import {IoIosHome, IoIosMailOpen} from "react-icons/all";
import Homepage from "../../../DemoPages/Homepage";

const MyBreadcrumb = () => {
    const paths = ['home','book','best seller'];

    return (<Fragment>
        <Breadcrumb>
            {paths.map((path) => (
                <BreadcrumbItem>{path}</BreadcrumbItem>
            ))}
        </Breadcrumb>
    </Fragment>);
};

export default MyBreadcrumb;
